import React from "react";

function Header() {
    const title = "";
    const vision = "New Vision"
    const respencive = "A Respencive Map"
    const client = "vision"
    if (client === "vision") {
        title = vision

    }else {
        title = respencive
    }
    return(
        <h1 className="navbar bg-primary text-white  p-2 mt-3 rounded">APC  {title} For Your Life</h1>
    );
}

export default Header;
